    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Tetlin NWR for the next 15 years. This plan outlines
    the Refuge vision and purpose and describes how Tetlin NWR will contribute to the
    overall mission of the Refuge System. The plan provides an introduction to the Refuge,
    an overview of the CCP process, a summary of Refuge resources, legal policies, and
    strategies for implementation and monitoring. Key planning issues include: visitor
    services, public use facilities, fire management, habitat management, and fisheries
